import React, { Component } from "react";
import LItem from "../LItem";

export default class List extends Component {
  render() {
    const { todoLst,updateToDoItem } = this.props;
    return (
      <section className="todo-list">
        <h3>TODO LIST</h3>
        <div className="list" id="todo-list">
          <div>
            {todoLst.map((item) => {
              return <LItem key={item.id} {...item} updateToDoItem={updateToDoItem}></LItem>;
            })}
          </div>
        </div>
      </section>
    );
  }
}
